import React, { useState, useEffect } from 'react';
import logo from "../images/logo.jpg"
import './Navbar.css';

function Navbar() {
 
  return (
    <>
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
      <a class="navbar-brand" href="#">
        <img src={logo}/>
      </a>
    </nav>

    </>
  );
}


export default Navbar;
